        "# Calcular la matriz de correlaci√≥n entre todas las variables\n",
        "correlation_matrix = data.corr()\n",
        "\n",
        "# Mostrar la correlaci√≥n de todas las variables independientes\n",
        "plt.figure(figsize=(10, 8))\n",
        "sns.heatmap(correlation_matrix.drop('comprar', axis=1), annot=True, cmap='coolwarm', linewidths=0.5)\n",
        "plt.title('Correlaci√≥n entre variables independientes', fontsize=16)\n",
        "plt.show()\n",
        "\n",
        "# Calcular la correlaci√≥n entre las variables independientes y la variable objetivo\n",
        "correlation_with_target = correlation_matrix['comprar'].drop('comprar')\n",
        "\n",
        "# Mostrar la correlaci√≥n con la variable a predecir\n",
        "plt.figure(figsize=(8, 6))\n",
        "correlation_with_target.abs().sort_values(ascending=False).plot(kind='bar', color='skyblue')\n",
        "plt.title('Correlaci√≥n con la variable a predecir', fontsize=16)\n",
        "plt.xlabel('Variables independientes', fontsize=14)\n",
        "plt.ylabel('Coeficiente de correlaci√≥n absoluto', fontsize=14)\n",
