        "from sklearn.feature_selection import SelectKBest\n",
        "X = data.drop(['comprar'], axis=1)\n",
        "y = data['comprar']\n",
        "\n",
        "# Dividir los datos en conjuntos de entrenamiento y prueba (80% entrenamiento, 20% prueba)\n",
        "X_train, X_test, y_train, y_test = train_test_split(X, y, test_size=0.2, random_state=2)\n",
        "\n",
        "# Crear y entrenar el modelo Naive Bayes con todas las variables\n",
        "model_all_features = GaussianNB()\n",
        "model_all_features.fit(X_train, y_train)\n",
        "\n",
        "# Realizar predicciones en el conjunto de prueba con todas las variables\n",
        "y_pred_all_features = model_all_features.predict(X_test)\n",
        "\n",
        "# Calcular la precisi√≥n del modelo con todas las variables\n",
        "accuracy_all_features = accuracy_score(y_test, y_pred_all_features)\n",
        "\n",
        "# Seleccionar las 5 mejores caracter√≠sticas utilizando SelectKBest\n",
        "selector = SelectKBest(score_func=f_classif, k=5)\n",
        "X_train_selected = selector.fit_transform(X_train, y_train)\n",
        "selected = selector.get_support(indices=True)\n",
        "print(X.columns[selected])\n",
        "X_test_selected = selector.transform(X_test)\n",
        "\n",
        "\n",
        "\n",
        "# Crear y entrenar el modelo Naive Bayes con las 5 mejores caracter√≠sticas\n",
        "model = GaussianNB()\n",
        "model.fit(X_train_selected, y_train)\n",
        "\n",
        "# Realizar predicciones en el conjunto de prueba con las 5 mejores caracter√≠sticas\n",
        "y_pred_selected_features = model.predict(X_test_selected)\n",
        "\n",
        "# Calcular la precisi√≥n del modelo con las 5 mejores caracter√≠sticas\n",
        "accuracy_selected_features = accuracy_score(y_test, y_pred_selected_features)\n",
        "\n",
        "# Mostrar la precisi√≥n del modelo\n",
        "print(\"Precisi√≥n con todas las variables:\", accuracy_all_features)\n",
        "print(\"Precisi√≥n con las 5 mejores caracter√≠sticas:\", accuracy_selected_features)\n",
        "\n",
        "# Predicciones para los casos dados (utilizando las 5 caracter√≠sticas seleccionadas)\n",
        "case1 = [[2000, 0, 5000, 0, 2]]\n",
        "case2 = [[6000, 0, 34000, 2, 2]]\n",
        "\n",
        "# Realizar predicciones para ambos casos\n",
        "prediction_case1 = model.predict(case1)\n",
        "prediction_case2 = model.predict(case2)\n",
        "\n",
        "# Mostrar las predicciones\n",
        "print(\"Predicci√≥n para el Caso 1:\", \"comprar\" if prediction_case1[0] == 1 else \"no comprar\")\n",
        "print(\"Predicci√≥n para el Caso 2:\", \"comprar\" if prediction_case2[0] == 1 else \"no comprar\")\n"
